import React from 'react';

function Contact() {
  return (
    <div>
      <h1>Contact Us</h1>
      <p>Email: ssehomedecor@gmail.com</p>
      <p>Phone: 7207147729</p>
      <p>Address: Shop no 29-1447, West Kakatiya Nagar, Kakatiya Nagar, Sainik Viahar, Neredmet, Hyderabad, Secunderabad, Telangana 500056</p>
    </div>
  );
}

export default Contact;
